CREATE SCHEMA IF NOT EXISTS youtubetrends;
USE youtubetrends;

DROP TABLE IF EXISTS Likes;
DROP TABLE IF EXISTS searchhistory;
DROP TABLE IF EXISTS VideoTrends;
DROP TABLE IF EXISTS Videos;
DROP TABLE IF EXISTS Categories;
DROP TABLE IF EXISTS Countries;
DROP TABLE IF EXISTS Comments;
DROP TABLE IF EXISTS Administrators;
DROP TABLE IF EXISTS Users;
DROP TABLE IF EXISTS Persons;

CREATE TABLE Categories (
 CategoryId INT,
 Title VARCHAR(255) NOT NULL,
 Assignable BOOLEAN DEFAULT FALSE,
 CONSTRAINT pk_Categories_CategoryId
  PRIMARY KEY(CategoryId)
);

CREATE TABLE Countries (
 CountryId INT AUTO_INCREMENT,
 CountryName VARCHAR(255) NOT NULL,
 CONSTRAINT pk_Countries_CountryId
  PRIMARY KEY(CountryId)
);


CREATE TABLE Persons (
    UserId INT auto_increment,
    FirstName VARCHAR(255),
    LastName VARCHAR(255),
    CONSTRAINT pk_Persons_UserId PRIMARY KEY (UserId)
);

CREATE TABLE Administrators (
    UserId INT,
    LastLogin TIMESTAMP DEFAULT CURRENT_TIMESTAMP,
    CONSTRAINT pk_Administrators_UserId PRIMARY KEY (UserId),
    CONSTRAINT fk_Administrators_UserId FOREIGN KEY (UserId)
        REFERENCES Persons (UserId)
        ON UPDATE CASCADE ON DELETE CASCADE
);

CREATE TABLE Users (
    UserId INT,
    DoB date NOT NULL,
    CONSTRAINT pk_Users_UserId PRIMARY KEY (UserId),
    CONSTRAINT fk_Users_UserId FOREIGN KEY (UserId)
        REFERENCES Persons (UserId)
        ON UPDATE CASCADE ON DELETE CASCADE
);


CREATE TABLE Comments (
    CommentId INT AUTO_INCREMENT,
    Content VARCHAR(1024) NOT NULL,
    Created TIMESTAMP DEFAULT CURRENT_TIMESTAMP NOT NULL,
    UserId INT,
    CONSTRAINT pk_Comment_CommentId PRIMARY KEY (CommentId),
    CONSTRAINT fk_Comment_UserId FOREIGN KEY (UserId)
        REFERENCES Users (UserId)
        ON UPDATE CASCADE ON DELETE SET NULL
);


CREATE TABLE `Videos` (
  `VideoId` int(11) NOT NULL AUTO_INCREMENT,
  `TrendingDate` varchar(255) NOT NULL,
  `Title` varchar(255) NOT NULL,
  `PublishTime` Date NOT NULL,
  `Tags` varchar(8096),
  `Views` bigint(10) DEFAULT '0',
  `CommentCount` bigint(10) DEFAULT NULL,
  `ThumbnailLink` varchar(255),
   `Dislikes` bigint(10) DEFAULT '0',
  `CommentsDisabled` BOOLEAN DEFAULT True,
  `RatingsDisabled` BOOLEAN DEFAULT True,
  `VideoErrorOrRemoved` BOOLEAN DEFAULT FALSE,
  `Description` MEDIUMTEXT,
  `CategoryId` int(11),
  `CountryId` int(11),
  `UserId` int(11),
  PRIMARY KEY (`VideoId`),
  CONSTRAINT fk_videos_categoryId
    FOREIGN KEY (CategoryId)
    REFERENCES Categories(CategoryId)
    ON UPDATE CASCADE ON DELETE Set NUll,
  CONSTRAINT fk_videos_CountyId
    FOREIGN KEY (CountryId)
    REFERENCES Countries(CountryId)
    ON UPDATE CASCADE ON DELETE Set NUll,
  CONSTRAINT fk_videos_userId
    FOREIGN KEY (UserId)
    REFERENCES Users(UserId)
    ON UPDATE CASCADE ON DELETE Set NUll
);

CREATE TABLE VideoTrends (
    VideoTrendsId INT AUTO_INCREMENT,
	VideoId INT,
    TrendingDate Date NOT NULL,
    Description varchar(255),
    CONSTRAINT pk_VideoTrends_VideoTrendsId PRIMARY KEY (VideoTrendsId),
    CONSTRAINT fk_VideoTrends_VideoId FOREIGN KEY (VideoId)
    REFERENCES Videos(VideoId)
    ON UPDATE CASCADE ON DELETE SET NULL
);


CREATE TABLE Likes (
    LikesId INT AUTO_INCREMENT,
	VideoId INT,
    UserId INT,
    Created TIMESTAMP DEFAULT CURRENT_TIMESTAMP,
    CONSTRAINT pk_Likes_LikesId PRIMARY KEY (LikesId),
    CONSTRAINT fk_Likes_VideoId FOREIGN KEY (VideoId)
    REFERENCES Videos(VideoId)
    ON UPDATE CASCADE ON DELETE CASCADE,
    CONSTRAINT fk_Likes_UserId FOREIGN KEY (UserId)
    REFERENCES Users(UserId)
    ON UPDATE CASCADE ON DELETE CASCADE
);

CREATE TABLE SearchHistory (
 ID INT AUTO_INCREMENT,
 SearchTime timestamp,
 SearchKeyWords VARCHAR(255),
 Counter INT,
 UserId INT,
 CONSTRAINT pk_SearchHistory_ID
  PRIMARY KEY(ID),
 CONSTRAINT fk_SearchHistory_UserId
  FOREIGN KEY (UserId)
  REFERENCES Users(UserId)
  ON UPDATE CASCADE ON DELETE SET NULL
);

